        "components/SpringScrollbars/SpringScrollbarsExample.js": {
          "import": "./components/SpringScrollbars/SpringScrollbarsExample",
          "content": "import random from 'lodash/random';\nimport { Component } from 'react';\nimport SpringScrollbars from './SpringScrollbars';\nimport { Lorem } from '../Lorem';\n\nexport default class SpringScrollbarsExample extends Component {\n  constructor(props, ...rest) {\n    super(props, ...rest);\n    this.handleClickRandomPosition = this.handleClickRandomPosition.bind(this);\n  }\n\n  handleClickRandomPosition() {\n    const { scrollbars } = this.refs;\n    const scrollHeight = scrollbars.getScrollHeight();\n    scrollbars.scrollTop(random(scrollHeight));\n  }\n\n  render() {\n    return (\n      <div className=\"separated\">\n        <SpringScrollbars ref=\"scrollbars\" style={{ height: 300 }}>\n          <Lorem />\n        </SpringScrollbars>\n\n        <button onClick={this.handleClickRandomPosition} style={{ marginTop: 40 }}>\n          <i className=\"fa fa-random\" /> Random position\n        </button>\n\n        <div className=\"text-xs text-gray-800 mt-4\">\n          <p>\n            The Scrollbars are animated with{' '}\n            <a\n              href=\"https://github.com/facebook/rebound-js\"\n              target=\"_blank\"\n              rel=\"noreferrer\"\n              className=\"font-bold text-black text-sm\"\n            >\n              Rebound\n            </a>\n            . You can simply animate the Scrollbars with <code>scrollbars.scrollTop(x)</code>.\n          </p>\n          <p>\n            Don't forget to wrap your steps with <code>requestAnimationFrame</code>.\n          </p>\n        </div>\n      </div>\n    );\n  }\n}\n"
        },
        "SpringScrollbars.js": {
          "import": "./SpringScrollbars",
          "content": "import { Component } from 'react';\nimport { Scrollbars } from 'rc-scrollbars';\nimport { SpringSystem, MathUtil } from 'rebound';\n\nexport default class SpringScrollbars extends Component {\n  constructor(props, ...rest) {\n    super(props, ...rest);\n    this.handleSpringUpdate = this.handleSpringUpdate.bind(this);\n  }\n\n  componentDidMount() {\n    this.springSystem = new SpringSystem();\n    this.spring = this.springSystem.createSpring();\n    this.spring.addListener({ onSpringUpdate: this.handleSpringUpdate });\n  }\n\n  componentWillUnmount() {\n    this.springSystem.deregisterSpring(this.spring);\n    this.springSystem.removeAllListeners();\n    this.springSystem = undefined;\n    this.spring.destroy();\n    this.spring = undefined;\n  }\n\n  getScrollTop() {\n    return this.refs.scrollbars.getScrollTop();\n  }\n\n  getScrollHeight() {\n    return this.refs.scrollbars.getScrollHeight();\n  }\n\n  getHeight() {\n    return this.refs.scrollbars.getHeight();\n  }\n\n  scrollTop(top) {\n    const { scrollbars } = this.refs;\n    const scrollTop = scrollbars.getScrollTop();\n    const scrollHeight = scrollbars.getScrollHeight();\n    const val = MathUtil.mapValueInRange(\n      top,\n      0,\n      scrollHeight,\n      scrollHeight * 0.2,\n      scrollHeight * 0.8,\n    );\n    this.spring.setCurrentValue(scrollTop).setAtRest();\n    this.spring.setEndValue(val);\n  }\n\n  handleSpringUpdate(spring) {\n    const { scrollbars } = this.refs;\n    const val = spring.getCurrentValue();\n    scrollbars.scrollTop(val);\n  }\n\n  render() {\n    return <Scrollbars {...this.props} ref=\"scrollbars\" />;\n  }\n}\n"
        },
